import React from 'react'
import { Header } from './headerStyle'
class header extends React.Component {
    constructor() {
        super()
        this.state = {
            lunch: "lunch active",
            dinner: "dinner"
        }
    }

    dateItem = (props) => {
        return (
            <button className="dateItem" active={props} >
                <span className="day">SEN</span>
                <span className="date">10</span>
