                    {this.dateItem()}
                    {this.dateItem()}
                </div>

                <div className="divider"></div>

                <div className="headerBtnList">
                    <button className={this.state.lunch}>Lunch</button>
                    <button onClick={this.btnEatingTime("dinner")} className={this.state.dinner}>Dinner</button>
                </div>
            </Header>
        )
    }
}

export default header
